import React, { MouseEventHandler } from 'react';
import { Key } from './style';

interface Props {
  label: number | string; 
  onClick: MouseEventHandler<HTMLButtonElement>;
  math?: boolean;
}

const Button = (props: Props) => {
  return (
    <Key onClick={() => props.onClick}>{props.label}</Key>
  );
};

export default Button;
